import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
         <div className="row">

            <div className="three columns">

               <img className="profile-pic"  src="images/profilepic.jpg" alt="" />

            </div>

            <div className="nine columns main-col">

               <h2>About Me</h2>
               <p>
               {
                 resumeData.aboutme
               }
               </p>

               <div className="row">

                  <div className="columns contact-details">

                  <h2>Contact Details</h2>
                  <p className="address">
       						<span>{resumeData.name}</span>
                     <br></br>
       						   <span>
                     {resumeData.address}
                    </span>
                    <br></br>
                    <span>{resumeData.website}</span>
       					   </p>
                  </div>
               </div>
               <button id="search-btn" class="search flex-row order-10 font-bold py-2 px-6 rounded focus:outline-none focus:ring focus:border-blue-300" type="button" id="search-btn">
                     <a href="./assets/images/T.Gentry Resume copy.pdf" id="trigger">Resume</a>
                  </button>
            </div>
         </div>
      </section>
    );
  }
}
